DELIMITER $$
--
-- Functions
--
CREATE DEFINER=`venkywhm`@`localhost` FUNCTION `getPoints` (`amount` DECIMAL, `parent_user_id` INT) RETURNS DECIMAL(10,2) BEGIN
   DECLARE points decimal(10,2) DEFAULT 0.00;
   DECLARE rewardPoint decimal(10,2) DEFAULT 0.00;
   DECLARE rewardPointMinimumAmount decimal(10,2);
   SELECT rr.value INTO rewardPoint from advertisment_customer_bill_reward_rules AS rr JOIN advertisment_customer_bill_rewards AS br ON br.id=rr.reward_id WHERE br.user_id=parent_user_id AND rr.code='reward-point-amount'; 
   
   SELECT rr.value INTO rewardPointMinimumAmount from advertisment_customer_bill_reward_rules AS rr JOIN advertisment_customer_bill_rewards AS br ON br.id=rr.reward_id WHERE br.user_id=parent_user_id AND rr.code='reward-point-minimum-amount'; 
	
	IF(rewardPoint > 0 && rewardPointMinimumAmount > 0 && amount >= rewardPointMinimumAmount) THEN
		SET points=rewardPoint * amount;
	END IF;
   RETURN (points);
END$$

DELIMITER ;

